import { Switch, Route, BrowserRouter } from "react-router-dom";
import "./App.css";
import Cards from "./components/Cards";
import Navbar from "./components/Navbar";
import ViewDragonBall from "./views/ViewDragonBall";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route>

        </Route>
        <Route path="/naruto">
          <Navbar>
            <Cards></Cards>
          </Navbar>
        </Route>
        <Route path="/dragonball">
          <ViewDragonBall></ViewDragonBall>
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
